/**
 * unicode -> GBK
 */
function stringToGBKByteArray(text) {// 0xABCD
    for(var buf = [], i = 0;i<text.length;i++){
   		var c = text.charCodeAt(i);
   	    if(c>0xA3){
   	    	c = charToGBK(c);
   	    }else{
   	    	c = [c];
   	    }
        buf.push.apply(buf,c);
    }
    return buf;
}
function charToGBK(ch) {// 0xABCD
    if(typeof index1 == 'string'){
        index1 = base64ToByteArray(index1)
    }     
	var offset = index1[ch >> 8] << 8;// index1[0xAB]00
	var dataIndex = offset >> 12;
	var index2 = data[dataIndex];
	if(typeof index2 == 'string'){
        index2 = base64ToByteArray(index2);
	    data[dataIndex] = index2;
    }
    var begin = 2*((offset & 0xfff) + (ch & 0xff));
	return index2.slice(begin,begin+2);
}
